import "./App.css";
import Form from "./Form";
import MapBasics from "./Map";
import Grid from "@material-ui/core/Grid";

function App() {
  return (
    <>
      <div>
        <Form></Form>
      </div>
      <div
        style={{
          position: "absolute",
          left: "50px",
          top: "0px",
          zIndex: "-4px",
        }}
      >
        <MapBasics></MapBasics>
      </div>
    </>
  );
}

export default App;
